                  disableMonitor: true,
                  arguments: {
                      num: {
                          type: "number",
                          defaultValue: 8,
                      },
                      type1: {
                          type: "string",
                          menu: 'unitType',
                      },
                      type2: {
                          type: "string",
                          menu: 'unitType',
                      }
                  },
